import React from "react";

export default function HomeSection() {
  return (
    <>
      <div className="bg-white flex w-full flex-wrap">
        <div className="w-1/2 bg-blue-300">1</div>
        <div className="w-1/2 bg-red-400">2</div>
      </div>
    </>
  );
}
